import Profile from './components/Profile';

const person = [
  {
    name: 'Geo',
    age: '18',
    hobbies: ['spoerts', 'music']
  },
  {
    name: 'Tom',
    age: '25',
    hobbies: ['movie', 'music']
  },
  {
    name: 'Lisa',
    age: '21',
    hobbies: ['sports', 'travel', 'game']
  }
]

const Example = () => {
  return (
    <>
      <ul>
        <Profile  />
        <Profile name='Lisa' age='21' hobbies={['sports', 'travel', 'game']} />
      </ul>
    </>
  );
};

export default Example;
